  $templateCache.put('scripts/verifiedpixel-imagelist/views/glossary.html',
    "<div class=\"metadata-view glossary\"><h3>Glossary</h3><!-- General Terms --><h4>Application general terms</h4><dl><dt>GRIS</dt><dd>Google Reverse Image Search. GRIS is Google's service that tells if a photo has been indexed on the web.</dd><dt>TinEye</dt><dd>TinEye is a reverse image search that looks at some of the web, plus other photo archives including stock photos.</dd><dt>TinEye count</dt><dd>The count of how many TinEye images that match the ingested item in Verified Pixel.</dd><dt>TinEye results</dt><dd>Links to the web pages that include the image that matches the one that has been ingested by Verified Pixel, as indexed by TinEye</dd><dt>EXIF</dt><dd>A standard for handling metadata in photos. EXIF metadata is stored inside the photo file itself. EXIF stands for EXchangeable Image File Format.<br><a href=\"https://en.wikipedia.org/wiki/Exchangeable_image_file_format\">https://en.wikipedia.org/wiki/Exchangeable_image_file_format</a></dd><dt>Ingest</dt><dd>The process of taking images into the Verified Pixel system.</dd><dt>Thumbnail</dt><dd>A small version of the ingested photo, with additional information to help determine at a glance if the image requires further attention.</dd><dt>Izitru</dt><dd>A service to help determine if a photograph has been altered since it was originally taken. Izitru runs a number of tests, which then result in a verdict.</dd><dt>Izitru verdict</dt><dd>A result summarizing the tests run by Izitru. The verdict ranges from 1 (camera original) to 5 (highly modified).</dd><dt>GRIS count</dt><dd>The count of images that match the items in Google's reverse image search (GRIS) index.</dd><dt>GRIS results</dt><dd>Links to the web pages that include the image that matches the one that has been ingested by Verified Pixel, as indexed by Google.</dd><dt>Item select</dt><dd>A toggle switch that selects an item for further actions (delete or download). Multiple items can be selected.</dd><dt>Delete</dt><dd>Permanently deletes an ingested image and its metadata from the Verified Pixel image archive.</dd><dt>Download</dt><dd>Downloads the item(s) from the image archive to the user's local computer. Images are sent in a .zip file format, which includes the image as it was sent, as well as any metadata and verification information collected in a text format.</dd><dt>Users</dt><dd>A registered user of the Verified Pixel instance.</dd><dt>Citizen</dt><dd>A member of the public who has sent in an item to Verified Pixel</dd></dl><!-- Navigation and Functions --><h4>Navigation and Functions</h4><dl><dt>Sort</dt><dd>Sorts items according to the criteria the user selects.</dd><dt>Search</dt><dd>A free-text window for searching any metadata associated with an ingested image, including placename, camera model, or date.</dd><dt>Page size</dt><dd>Selects the number of items to be displayed on a page; a number to the right of this pulldown menu provides a count of the number of items ingested.</dd><dt>List view/Grid view toggle</dt><dd>Switches the display of ingested items between a text-based list view and a thumbnail-based grid view.</dd></dl><!-- *All* tab --><h4>All Tab</h4><dl><dt>Map</dt><dd>The Google map showing the place the photo was taken, as well as, in certain instances, the direction the camera was pointing. Users can switch between standard map view and satellite view, as well as view the location in Google street view, where available.</dd><dt>Capture location</dt><dd>The name of the place the photo was taken.</dd><dt>GUID</dt><dd>The (G)lobal (U)nique (ID)entifier for the image. A unique key generated by Verified Pixel to help keep track of images.</dd><dt>Created</dt><dd>The date and time Verified Pixel received the image.</dd><dt>Last updated</dt><dd>The date and time any updates occurred on the image (if applicable).</dd><dt>Expiry</dt><dd>The date and time the image will be automatically erased from Verified Pixel.</dd><dt>Original source</dt><dd>The name and email of the image sender. The name may not always be available.</dd><dt>Source</dt><dd>The email account at Verified Pixel that the image was sent to.</dd></dl><!-- EXIF Metadata Tab --><h4>EXIF Metadata Tab</h4><p>See <a href=\"http://www.exiv2.org/tags.html\">http://www.exiv2.org/tags.html</a> for a complete explanation.</p><dl><dt>Lens make</dt><dd>The manufacturer of the lens used to capture the image.</dd><dt>Lens model</dt><dd>The model name of the camera used to capture the image.</dd><dt>Captured</dt><dd>The date and time the photo was taken. (same as Timestamp)</dd><dt>Timestamp</dt><dd>The date and time the photo was taken. (same as Captured)</dd><dt>Aperture</dt><dd>The lens aperture settings used on the image.</dd><dt>Exposure mode</dt><dd>The exposure mode used to create the image. Options are: Auto Exposure, Manual Exposure, Auto Bracket (camera shoots a series of frames at different exposure settings)</dd><dt>Exposure time</dt><dd>The amount of time the image was exposed.</dd><dt>Focal length</dt><dd>The actual focal length of the lens, in mm.</dd><dt>ISO</dt><dd>The ISO speed the image was taken at.</dd><dt>Flash</dt><dd>Indicates whether the flash was used in the photo</dd></dl><!-- GPS info --><h4>GPS info</h4><dl><dt>Latitude</dt><dd>The GPS latitude coordinate, measured in degrees and decimals, measured north to south. 90 degrees is the northernmost point.</dd><dt>Longitude</dt><dd>The GPS longitude coordinate, measured in degrees and decimals, measured east to west. 0 degrees is the Greenwich meridian.</dd><dt>Altitude</dt><dd>The GPS altitude measurement, in meters.</dd><dt>Capture direction</dt><dd>The degrees from north the image was taken. (This is also illustrated in a wedge shape on the map.)</dd><dt>Capture direction reference</dt><dd>The reference for the direction for giving the image when it was taken. T denotes true direction, M denotes magnetic direction.</dd></dl><!-- Izitru tab --><h4>Izitru Tab</h4><dl><dt>Izitru verdict</dt><dd>\"The Verdict field contains Izitru's overall assessment of the image, corresponding to the verdicts displayed on the public-facing izitru website. These verdicts weigh the results of all six forensic tests performed on izitru. The verdict is encoded as an integer from 0 to 4, corresponding to the following descriptions. [Note: As currently configured, our automated tests will never return a value of 4. This value is reserved for images that have undergone an expert review.]: 1. High Trust 2. Medium Trust 3. Undetermined File History 4. Potential File Modification 5. No Trust\"</dd><dt>Image quality</dt><dd>A score given by Izitru to rank image quality, where 100 is best and 0 is worst. The image quality is assessed from a combination of blur, noise, and compression in the image. A user who is aware that you are using forensic techniques to detect original images may try to fool the system by modifying a photo and then taking a new photograph of a computer display or printout. Because this process tends to degrade image quality, the image quality metric can be a useful tool for flagging a photo of a photo</dd><dt>JPEG structure</dt><dd>The JPEG structure analysis examines the way in which the data in a JPEG file is packaged. This structure tends to be different for files saved from cameras compared to files saved from photo editing programs. If the image passes this test, the value of this field will be “Passed” A value of “Failed”</dd><dt>Device signature analysis</dt><dd>Indicates whether the image passed or failed Izitru's device signature analysis. The JPEG signature which includes compression settings and other details of how an image was saved tends to be distinct from one camera model to another, and changes significantly when a file is saved from software. If the JPEG signature on a file matches a signature known to come from the device that first captured the image, then it is highly likely that the file is an original, unmodified image. This positive test result is indicated when the value of the deviceSignatureAnalysis field is \"Passed#. If the file did not pass this test, there are three possible values for this field. \"Metadata missing# indicates that the file was lacking the EXIF metadata that specifies what camera was used to capture the image, so a signature analysis could not be done. \"Unknown camera# indicates that the camera that was used to capture the image is not currently found in the izitru signature database, so a signature analysis could not be done. Finally, \"Failed# indicates that the izitru signature database does contain signatures for this camera, but none of them were a match for the signature found on the image file.</dd><dt>Sensor pattern analysis</dt><dd>Sensor pattern analysis relies on the fact that files captured from a digital camera at that camera!s native resolution generally contain traces of the color filter array that sits over the image sensor. These traces begin to fade away as the file is subsequently edited. If the image passes this test, the value of this field will be “Passed”, indicating that the file is likely an original from a digital camera. Otherwise, the value will be “Failed”</dd><dt>Multiple JPEG analysis</dt><dd>This field combines the results of three different izitru tests - Double JPEG Detection, JPEG Ghost Detection, and JPEG Coefficient Analysis. Each of these tests represents a different technique for detecting that a file has been compressed as a JPEG more than once, which can be a clue that the file may have been edited. In addition, each of these tests is conducted in multiple runs, and the number of possible runs may vary based on such things as the quality of the image and the amount of detail an image contains. The multiple JPEG Analysis field contains two numbers in the form \"[number of failed tests]/[total number of tests]. The second number represents the total number of test passes across all three tests, and the first number represents the number of those passes that failed. A healthy number of test runs is generally around 100 or more. If you see more than a handful of failed tests here, then that may be a strong indicator that the file is not an original. If no tests could be run, then this field will contain a value of \"NA\"</dd></dl><!--  TinEye Tab --><h4>TinEye Tab</h4><dl><dt>Tineye total results</dt><dd>The count of how many TinEye images that match the ingested item in Verified Pixel.</dd><dt>Tineye links</dt><dd>Links to the web pages that include the image that matches the one that has been ingested by Verified Pixel, as indexed by TinEye, with indicators showing when the images were posted.</dd><!-- GRIS tab --><h4>GRIS Tab</h4><dl><dt>Google total results</dt><dd>The count of how many Google images that match the ingested item in Verified Pixel.</dd><dt>Google links</dt><dd>Links to web pages that include the image that Google reverse image search has matched to the Verified Pixel image.</dd></dl><!-- Comments tab --><h4>Comments Tab</h4><dl><dt>Previous comments</dt><dd>Displays comments on the image by other Verified Pixel users on your team. The comments function also supports @username mentions, which get sent to the mentioned user by email.</dd></dl></dl></div>"
  );


